import React from 'react';

export const sublinks = [
  {
    page: 'buy',
    links: [
      {label: 'CDs', url: '/cd'},
       {label: 'clothing', url: '/clothing'},
        {label: 'special', url: '/special'}

    ]

  },
  {
     page: 'music',
    links: [
      {label: 'discography', url: '/discography'},
       {label: 'about', url: '/about'},
        {label: 'listen', url: '/listen'}

    ]

  },
  {
    page: 'contact',
    links: [
      {label: 'email', url: '/email'},
       {label: 'phone', url: '/phone'},
        {label: 'collaboration', url: '/collaboration'}

    ]

  },

];
